import MovieCard from "./MovieCard";
import Movie from '../data/Movie'
function MovieList() {
  return (
    <div>
     { Movie.map((movies)=>(
        <MovieCard key={movies.id}/>
      ))

     }
    </div>
  );
}

export default MovieList;
